import React from 'react';
import { Navbar3 } from '../../../../components';
import './passwordResult.css';

const PasswordResult = () => {

    async function handleFormSubmit(e) {
        e.preventDefault();

        try {
          // TODO: confirmPassword method in AuthContext
          navigate("/login");
        }
        catch (e) {
          console.log(e);
        }
    }

  return (
    <div>
    <Navbar3/>
    <div className='login'>
    <h1>Reset Password</h1>
      <div className='auth__result'>
        <form className='signup__fields' onSubmit={handleFormSubmit}>
            <input
            className='signup__input'
            required
            placeholder="Email"
            autoComplete='email'
            name='email'
            autoFocus
            ref={emailRef}
            onChange={(e) => setUserData({...userData, email: e.target.value})}
            />
            <input
            className={`signup__input ${password}`}
            required={passwordRequired}
            type='password'
            autoComplete='new-password'
            placeholder="Password"
            onChange={(e) => setUserData({...userData, password: e.target.value})}
            />
            {/*disabled={loading}> */}
            <button type="submit" className='signup__button'>
            {buttonText}
            </button>
        </form>
      </div>
    </div>
</div>
  )
}

export default PasswordResult
